import { Container, Row, Col } from 'react-bootstrap';
import Header from '../../shared/Header/Header';
import React from 'react';
import './Cart.css';

const Cart = (props) => {     
    return (
        <div className="cart">
            <Header />
            <Container>
                <Row>
                    <Col md={8}></Col>
                    <Col md={4}></Col>
                </Row>
            </Container>
        </div>
    )
}

export default Cart;
